// 移除所有其他不再需要的导入

const Product = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="dashboard-main">
        <div className="dashboard-welcome-container">
          <WelcomeHeader />
        </div>
        {/* 此处已清空 Product 页面的主要内容 */}
      </div>
    </div>
  );
};

export default Product;
